import React, { Fragment } from 'react';
import Header from './Header';
import Body from './Body';
import Footer from './Footer';

function Home() {
  return (
    <Fragment>
      <Header/>
      <Body/>
      <Footer/>
    </Fragment>
  );
}

export default Home;
